import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Data from './components/countriesData/data.js';

export default function App() {
  return (
    <Router>        
        <Switch>
          <Route exact path="./components/countriesData">
            <Data />
          </Route>
        </Switch>
    </Router>
  );
}
